import React from 'react';
import Slideshow from '../Slideshow/Slideshow'; // Import the Slideshow component
import DarkModeToggle from '../DarkModeToggle/DarkModeToggle';
import './About.css'; // Make sure you have your CSS for the About component

import image1 from '../images/callIcon.png';
import image2 from '../images/githubLogo.png';


// Define your slides here
const slides = [
  {
    image: image1,
    caption: 'Our Team',
  },
  {
    image: image2,
    caption: 'Our Workspace',
  },
];

function About() {
  return (
    <div className="about">
      <h1>About Us</h1>
      <Slideshow slides={slides} className = "about_slideshow" /> {/* Add the Slideshow component here */}
      {/* ...other content */}
    </div>
  );
}

export default About;
